input {
  outline: 0;
}

.login-header {
  margin: auto;
  max-width: 1400px;
  height: 200px;
  background-repeat: no-repeat;
  background-position: left center;
}

.login-space {
  position: relative;
  display: block;
  height: 100%;
  background: url('../common/images/login/bj.png') no-repeat center;
  background-size: 100% 100%;
}

.login-warp {
  width: 500px;
  height: 400px;
  padding: 30px;
  background-color: rgba(255, 255, 255, 0.7);
  border-radius: 10px;
  top: 16%;
  margin: 0 auto;
}

.login-title {
  height: 80px;
  line-height: 80px;
  text-align: center;
  font-size: 20px;
}

.login-input-warp {
  margin-bottom: 0;
  border: solid 1px #c1c4cd;
  line-height: 50px;
  background-color: #f3f6fd;
  border-radius: 6px;
  padding: 0 10px 0 40px;
  background-repeat: no-repeat;
  background-position: 11px center;
  background-image: url('../common/images/login/user.png');
  margin-bottom: 20px;
  transition: all 0.3s;
}

.login-input-warp:hover {
  background-color: #ffffff;
  border-color: #3b99fc;
}

.login-input-warp.login-pwd {
  background-image: url('../common/images/login/pwd.png');
}

.login-input-warp input {
  width: 100%;
  background-color: transparent;
  line-height: 50px;
  background-position-x: 13px;
}

.login-btn {
  width: 100%;
  margin: 10px 0;
  height: 50px;
}

.login-footer {
  text-align: center;
  position: absolute;
  width: 100%;
  bottom: 0;
  line-height: 60px;
  font-size: 16px;
}
